app.get(
  "/login/:provider/callback",
  async function(request, reply) {
    const { provider } = request.params;
    if (!provider)
      throw new InvalidRequestError("Missing provider");
    let access_token;
    switch (provider) {
      case "google" /* Google */: {
        const res = await app.googleOAuth2.getAccessTokenFromAuthorizationCodeFlow(request);
        access_token = res.token.access_token;
        break;
      }
      case "github" /* Github */: {
        const res = await app.githubOAuth2.getAccessTokenFromAuthorizationCodeFlow(request);
        access_token = res.token.access_token;
        break;
      }
      default:
        throw new ServerError("Invalid provider");
    }
    const userInfo = await loadUserInfo(provider, access_token);
    if (!userInfo)
      throw new ServerError("Failed to load user data");
    const { userId, name: name2, picture } = await handleProviderLogin(provider, userInfo);
    if (!userId)
      throw new ServerError();
    reply.setCookie("user", JSON.stringify({ userId, name: name2, picture }), {
      ...cookieSettings,
      httpOnly: false
    });
    reply.setCookie("user_id", userId, {
      ...cookieSettings,
      httpOnly: true
    });
    reply.setCookie("access_token", access_token, {
      ...cookieSettings,
      httpOnly: true
    });
    reply.redirect("/");
  }
);
async function handleProviderLogin(provider, info) {
  const userAuth = await authService.getByProviderId(provider, info.id);
  switch (provider) {
    case "google" /* Google */: {
      const { name: name2, picture, id, email } = info;
      const userId = await saveUser(provider, userAuth, name2, picture, id, email);
      return { userId, name: name2, picture };
    }
    case "github" /* Github */: {
      const { login, avatar_url, id, email } = info;
      const userId = await saveUser(provider, userAuth, login, avatar_url, id, email);
      return { userId, name: login, picture: avatar_url };
    }
    default:
      throw new ServerError("Invalid provider");
  }
}
async function saveUser(provider, auth, name2, picture, id, email) {
  const user = await userService.save({
    id: auth?.userId,
    name: name2,
    avatarUrl: picture
  });
  if (!user)
    throw new ServerError();
  if (!auth) {
    const res = await authService.save({
      email,
      provider,
      providerId: id,
      userId: user.id
    });
    if (!res)
      throw new ServerError();
  }
  return user.id;
}
